import React from 'react';
import { NavLink } from 'react-router-dom';

const Sidebar = () => {
  const sidebarStyle = {
    width: '200px',
    background: '#f5f5f5',
    padding: '20px'
  };

  const linkStyle = {
    display: 'block',
    marginBottom: '10px',
    textDecoration: 'none',
    color: '#333'
  };

  return (
    <div style={sidebarStyle}>
      <h2>Menu</h2>
      <NavLink to="/" style={linkStyle}>Accueil</NavLink>
      <NavLink to="/playlists" style={linkStyle}>Mes Playlists</NavLink>
    </div>
  );
};

export default Sidebar;
